import React from "react";
import Box from '@mui/material/Box';
import zIndex from "@mui/material/styles/zIndex";
import Avatar from '@mui/material/Avatar';

function Signin(){

    return(

        <Box
      sx={{
        width: 850,
        height: 350,
        position:'relative',
        left:400,
        top:250,
        display:'flex',
        flexDirection:'row',
        border:'2px solid red'
         }}>
             <Box sx={{
                    width:'60%',
                    height:'70%',
                    border:'1px solid green',
                    position:'relative',
                    top:50,
                    zIndex:0,
                    background:'#F5F5F5'



             }}>
                 <Avatar

                    src="./signin/signin1.jpg"
                    sx={{ width: 350, height: '100%',position:'relative',left:30 }}
                 />

             </Box>

             <Box sx={{
                 width:'400px',
                 height:'100%',
                 border:"1px solid blue",
                 position:'absolute',
                 zIndex:2,
                 background:'#FFFFFF',
                 right:30}}>


             </Box>

        </Box>
    )

}
export default Signin
